import React from 'react';

type TaskType = {
    task:Array<ArrayTaskType>
}

type ArrayTaskType = {
    id:number;
    title:string;
    isDone:boolean
}


export  const ToDolist = (props:TaskType) => {
    return (
        <div>  {props.task.map((el)=>{
            return(
                <div>{ <li key={el.id}>
                    <ul>{el.title}</ul>
                </li>

                }
                    <input  type={"checkbox"} checked={el.isDone} />
                    <button>x</button>
                </div>
            )
        })}


        </div>
    );
};
